import React from 'react';
import './App.css';
import Header from '../components/Header.js/index.js';
import Footer from '../components/Footer.js/index.js';

export default function App() {
  return (
    <div className="App">
      <Header title="もちまっちげーみんぐ" />

      <Footer text="copyright" />
    </div>
  );
}
